import { I18nextProvider } from 'react-i18next';





const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <I18nextProvider  i18n={i18next}>
    <App />
    </I18nextProvider>

  </React.StrictMode>
);
